        </div>
        <div className= "owners-email">
        enter owners-email
          <input type ="text" value={this.state.value} onChange={this.handleChange} />/>

        </div>
        <div className= "pets-description">
        enter pets-description
        <textarea rows={4}></textarea>
        </div>
      </div>


    );
  }

}



export default App;
